function Navbar() {
  return (
    <nav style={{
      backgroundColor: '#0d6efd', // Fondo azul
      color: 'white',
      padding: '1rem',
      textAlign: 'center',
      fontWeight: 'bold',
      fontSize: '1.5rem'
    }}>
         <h1 style={{ marginLeft: '20px' }}>Sistema de Parqueadero</h1> {/* Alineado a la izquierda */}
      <h1>SISTEMA DE PARQUEADERO MY PARKING</h1>
    </nav>
  );
}   

export default Navbar;
